import styled from "styled-components";

const StyledList = ({ content }) => {
  return <Title>{content}</Title>;
};

export default StyledList;

const Title = styled.div`
  color: AliceBlue;
  font-size: 22px;
  margin: 2.5%;
  text-align: center;
`;
